import React from 'react';


const propTypes = {};

const defaultProps = {};

const cardMain = {
    backgroundColor: "rgb(0, 0, 0, 0.5)",
    // backgroundColor: "red",
    width: "500px",
    height: "500px",
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-between",
    alignItems: "top",
    paddingTop: "0"
}

const cardImg = {
    width: "100%",
    height: "100%",
    objectFit: "fill",
    margin: "0",
    padding: "0"
}

const cardTextContainer = {
    padding: "0.7em 2em",
    color: "white"
}

const cardTitle = {
    fontWeight: "bold",
    textDecoration: "underline"
}

const ProjectCard = () => {
    return <div style={cardMain}>
        <img style={cardImg} src="netflixClone.png" />
        <div style={cardTextContainer}>
            <h3 style={cardTitle}>Netflix clone page</h3>
            <div>
                <p><strong>Description:</strong> A copy of a Netflix website with user
                sign-up and sign-in pages<br style={{ marginTop: "1em" }} /> <strong>Technology: </strong> React, CSS, HTML, Javascript, Firebase</p>



            </div>

        </div>


    </div>;
}

ProjectCard.propTypes = propTypes;
ProjectCard.defaultProps = defaultProps;
// #endregion

export default ProjectCard;
